g2:c.PROCEDURE.g2:a.TEXT:
_pingmgr-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces;
  intstuffName: symbol  = the symbol int-internals-workspaces;
  Err: class error;

begin

  {--- No startup required for module restart }
  if not(InitialStartup) then return;

  {--- For devstuff development environment } 
  if the item named by devstuffName exists then
    insert _pingmgr-internals at the end of the item-list named by devstuffName;
  if the item named by intstuffName exists then
    insert _pingmgr-internals at the end of the item-list named by intstuffName;

end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end

pm-do-device-poll-with-time-to-live(ping-interface : class gsi-interface, dev-name : text, ip-address : text, time-out: integer) = (text)
poll-rec : class pm-poll-receiver;
clean-up-poll-rec : truth-value = true;
errobj : class error;

S : text = "NO-RESPONSE";
dev, ip , status : text;
interval, max-retries : integer; 
begin
   if there exists a pm-poll-receiver poll-rec such that (the pm-device-name of poll-rec = dev-name) then begin
          clean-up-poll-rec = false;
           conclude that this procedure-invocation is the-poll-procedure-of poll-rec;
    end
   else
      begin
        create a pm-poll-receiver poll-rec ;
        transfer poll-rec to the subworkspace of this procedure at ( random(200), random(200));
        conclude that the pm-device-name of poll-rec = dev-name;
        start pm-do-demand-poll-rpc (dev-name, ip-address) across ping-interface; 
     end;
   do in parallel until one completes 
        wait for time-out;
        wait until the pm-poll-status of poll-rec receives a value;
   end;
   if the pm-poll-status of poll-rec /= "" then 
        S = the pm-poll-status of poll-rec;
   if clean-up-poll-rec then begin
    repeat
        allow other processing;
        exit if not (there exists a procedure-invocation that is the-poll-procedure-of poll-rec);
        conclude that the pm-poll-status of poll-rec = the pm-poll-status of poll-rec;
    end;
        delete poll-rec;
    end;
    return S;
end 
on error (errobj)
    if poll-rec exists then begin
        conclude that the pm-poll-status of poll-rec = "NO-RESONSE";
        allow other processing;
        if clean-up-poll-rec then 
            delete poll-rec;
    end;
    return "NO-RESPONSE";
end

pm-do-device-poll(ping-interface : class gsi-interface, dev-name : text, ip-address : text) = (text)
poll-rec : class pm-poll-receiver;
clean-up-poll-rec : truth-value = true;
errobj : class error;

S : text = "NO-RESPONSE";
dev, ip , status : text;
interval, time-out, max-retries : integer; 
begin
    time-out = pm-no-response-time-out-in-sec;
   {dev, ip, interval, time-out, max-retries, status = call PM-GET-DEVICE-CONFIG-RPC (dev-name) across ping-interface;}
    {Getting no-response timeout from pm-no-response-time-out-in-sec}

   if there exists a pm-poll-receiver poll-rec such that (the pm-device-name of poll-rec = dev-name) then begin
          clean-up-poll-rec = false;
           conclude that this procedure-invocation is the-poll-procedure-of poll-rec;
    end
   else
      begin
        create a pm-poll-receiver poll-rec ;
        transfer poll-rec to the subworkspace of this procedure at ( random(200), random(200));
        conclude that the pm-device-name of poll-rec = dev-name;
        start pm-do-demand-poll-rpc (dev-name, ip-address) across ping-interface; 
     end;
   do in parallel until one completes 
        wait for time-out;
        wait until the pm-poll-status of poll-rec receives a value;
   end;
   if the pm-poll-status of poll-rec /= "" then 
        S = the pm-poll-status of poll-rec;
   if clean-up-poll-rec then begin
    repeat
        allow other processing;
        exit if not (there exists a procedure-invocation that is the-poll-procedure-of poll-rec);
        conclude that the pm-poll-status of poll-rec = the pm-poll-status of poll-rec;
    end;
        delete poll-rec;
    end;
    return S;
end 
on error (errobj)
    if poll-rec exists then begin
        conclude that the pm-poll-status of poll-rec = "NO-RESONSE";
        allow other processing;
        if clean-up-poll-rec then 
            delete poll-rec;
    end;
    return "NO-RESPONSE";
end

pm-issue-device-status (Dev: text, DevStatus: text, Id: text)
PollRec: class pm-poll-receiver;
begin
    {inform the operator for the next 1 minute that "[the name of this procedure] : [dev] : [dev-status]";}
    if there exists a pm-poll-receiver PollRec such that (the pm-device-name of PollRec = Dev) then conclude that the pm-poll-status of PollRec = DevStatus;
    if there exists a procedure P named by pm-application-specific-proc-name then start P (Dev, DevStatus, Id);
end

g2:c.METHOD.g2:a.TEXT:
gdsm-network-interface-get-status (io: class pingmgr-gsi-interface {The gsi interface connection to refresh.} ) = (symbol {The state of the interface: connected, not-connected, in-transition, timed-out, or connection-lost})

{This method will determine if the state of the network connection between the interface and the gateway process, refresh the icon of the gateway interface in accordance with the information obtained, and return the state of the interface (returning one of the symbols: connected, not-connected, in-transition, timed-out, or connection-lost).  Refer also to:
   procedure gdsm-handle-bridge-connection and gdsm-update-bridge-icon.
} 

  icon-layer-exists: truth-value = false;

begin
  return the symbol do-not-process;
end
